import React from 'react';

const Home = props => {
  const friendsButton = () => {
    props.history.push('/friends');
  };

  const homeButton = () => {
    props.history.push('/');
  };

  const addButton = () => {
    props.history.push('/signup');
  };

  return (
    <div class="navCont">
      <nav class="navBar">
        <button class="home">Home</button>
        <button class="friends">Friends</button>
        <button class="addFriend">Add Friend</button>
      </nav>
    </div>
  );
};

export default Home;
